import axios from "axios";
import { requiredData } from "../../../constants/globalFunction.js";

export const GET_DATA = "GET_DATA";
export const MODAL_POP_UP = "MODAL_POP_UP";

const URL = "https://devza.com/tests/tasks/";
const API_KEY = "e5PhLmwULk9R4nlIMqTzbXnLt5QqiXUN";

export const geStackExchanegeData = (
  newStartDate,
  newEndDate,
  pageSize,
  pageNumber
) => async (dispatch) => {
  const headers = {
    "Content-Type": "application/json",
    AuthToken: API_KEY,
  };
  try {
    const newUrl = `${URL}/listusers`;
    const response = await axios.get(newUrl, { headers });
    if (response?.status === 200) {
      dispatch({
        type: GET_DATA,
        payload: requiredData(response?.data?.items),
      });
    }
    return response;
  } catch (ex) {
    return ex;
  }
};

export const getListOfUsers = () => async (dispatch) => {
  try {
    const newUrl = `${URL}page=${pageNumber}&pagesize=${pageSize}&fromdate=${newStartDate}&todate=${newEndDate}&order=desc&sort=popular&site=stackoverflow`;
    const response = await axios.get(newUrl);
    if (response?.status === 200) {
      dispatch({
        type: GET_DATA,
        payload: requiredData(response?.data?.items),
      });
    }
    return response;
  } catch (ex) {
    return ex;
  }
};

//-----Modal popup-------//
export function modalPopUp(value) {
  return (dispatch) => {
    dispatch({
      type: MODAL_POP_UP,
      payload: value,
    });
  };
}
